import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;
class BM {
	static int max(int a, int b) { return (a > b) ? a : b; }

	static int 	index(char c) {
		switch (c) {
			case 'A': return 0;
			case 'C': return 1;
			case 'G': return 2;
			case 'T': return 3;
			default: throw new IllegalArgumentException("Invalid DNA character: " + c);
		}
	}

	static List<Double> search(char[] pat, char[] txt) {
		long startTime = System.nanoTime();
		int m = pat.length;
		int n = txt.length;
		int a = 4;
		int shifts = 0;
		// preprocessing
		int[] badchar = new int[a];
		for (int i = 0; i < a; i++)
			badchar[i] = -1;
		for (int i = 0; i < m; i++)
			badchar[index(pat[i])] = i;


		// actual searching
		int i = 0;
		while (i <= (n - m)) {
			int j = m - 1;
			while (j >= 0 && pat[j] == txt[i + j]) {
				shifts++;
				j--;
			}
			shifts++;
			if (j < 0) {
				// System.out.println("Pattern found at index " + (i));
				i += (i + m < n) ? m - badchar[index(txt[i + m])] : 1;
			} else {
				i += max(1, j - badchar[index(txt[i + j])]);
			}
		}

		long endTime = System.nanoTime();
		double runningTime = (endTime - startTime) / 1e6;
		double throughput = (double) n / runningTime;

		System.out.println("Total shifts: " + shifts);
		System.out.println("Running time: " + String.format("%.6f", runningTime) + " ms");
		System.out.println("Throughput: " + String.format("%.2f", throughput) + " characters/ms");
		List<Double> list = new ArrayList<>(Arrays.asList(runningTime, throughput));
		return list;
	}

	public static void main(String[] args) {
		// char[] txt = "".toCharArray();
		String txt = "";
		char[] txt1 = new String(new char[10]).replace("\0", txt).toCharArray();
		char[] pat = "AGGCT".toCharArray();
		double runningTime = 0;
		double throughput = 0;
		for (int i = 0; i < 100; i++) {
			List<Double> data = search(pat, txt1);
			runningTime += data.get(0);
			throughput += data.get(1);
		}
		System.out.println(runningTime/100);
		System.out.println(throughput/100);
	}
}
